import Form from 'react-bootstrap/Form';
import React, { useEffect, useState } from "react"
import Table from 'react-bootstrap/Table';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function UserSelectionForm(props) {

    const [stateForceCrime, setstateForceCrime] = useState({force: "", crime: ""});
    const [crimeCategorties, setCrimeCategorties] = useState([])
    const [neighbourhoods, setNeighbourhoods] = useState([])
    const [stopSearch, setStopSearch] = useState([])
    const [isLoadingStop, setLoadingStop] = useState(false);
    const [isLoadingForce, setLoadingForce] = useState(false);
    const [isLoadingCrime, setLoadingCrime] = useState(false);
    const [isLoadingCrimeAndForce, setLoadingCrimeAndForce] = useState(false);

    console.log(props.crime, props.force, props.submitStopandSearch);

    function handle(e)
    {
        const data = {...stateForceCrime}
        data[e.target.id] = e.target.value
        setstateForceCrime(data)
    }

    function submit(e)
    {
        setLoadingCrimeAndForce(true);
        e.preventDefault()
        fetch(`https://data.police.uk/api/crimes-no-location?category=${stateForceCrime.crime}&force=${stateForceCrime.force}`)
        .then(response => {
            return response.json()
        })
        .then(data => {
            setNeighbourhoods(data)
            setLoadingCrimeAndForce(false)
        })
    }

        setLoadingStop(true);
        fetch(`https://data.police.uk/api/stops-no-location?force=${props.submitStopandSearch}`)
          .then(response => {
            return response.json()
          })
          .then(data => {
            setStopSearch(data)
            setLoadingStop(false);
          })





  return (
    //   <>
    //    <div className="container">
    //     <div className="form-box">
    //   <Row className="justify-content-md-center">
    //     <Col md="auto">Variable width content</Col>
    //   <Form onSubmit={(e)=>submit(e)}>
